import Card from '../../../UI/Card';

const UserInput = props => {
  return (
    <Card>
      <form>
        <div>
          <div>
            <label>Name</label>
            <input />
          </div>
          <div>
            <label>Age (Years)</label>
            <input />
          </div>
        </div>
        <div>
          <button>Add User</button>
        </div>
      </form>
    </Card>
  );

};

export default UserInput;
